using System;
using System.Linq;
using System.Collections;
using System.Collections.Generic;
using System.Net.Http;
using System.Text;
using UnityEngine;
using System.Text.RegularExpressions;

public class PlateRecognitionScript : MonoBehaviour
{
    private string Url = "https://api.platerecognizer.com/v1/plate-reader";
    private string Token = "407a9b5d2d0548ff9764e771bcec3baf674bf1b6";

    // Start is called before the first frame update
    void Start()
    {
        string b64 = "";
        byte[] bytePlate = Convert.FromBase64String(b64);

        var recognition = RecognizePlate(bytePlate);
        if (recognition == null)
            return;

        var plate = recognition;
        Debug.Log(plate);
    }

    // Update is called once per frame
    void Update()
    {

    }

    public string RecognizePlate(byte[] bytePlate)
    {
        //string b64 = "";
        //bytePlate = Convert.FromBase64String(b64);

        string base64String = Convert.ToBase64String(bytePlate);

        var content = new StringContent("{\"upload\":\"" + base64String + "\"}",
            Encoding.UTF8, "application/json");

        using var httpClient = new HttpClient();

        // Set the authorization token in the request header
        httpClient.DefaultRequestHeaders.Add("Authorization", $"Token {Token}");

        // Make the POST request
        HttpResponseMessage response = httpClient.PostAsync(Url, content).Result;

        // Check if the request was successful (status code 2xx)
        if (!response.IsSuccessStatusCode)
            return response.ToString();
        //throw new Exception("Failed to detect", null, response.StatusCode);

        // Read and print the response content
        string responseContent = response.Content.ReadAsStringAsync().Result;

        return Plat1(responseContent);
    }

    string Plat1(string content)
    {
        return JsonUtility.FromJson<PlateRecognitionResponse>(content).AccuratePlate();
    }

    string Plate2(string content)
    {
        // Use regular expressions to find the property in the JSON string
        string pattern = $"\"plate\":(.*?)[,}}]";
        Match match = Regex.Match(content, pattern);

        if (match.Success)
        {
            // Extract the value of the property
            string propertyValue = match.Groups[1].Value.Trim();
            return propertyValue;
        }
        else
        {
            return string.Empty;
        }
    }
}

[System.Serializable]
public class PlateRecognitionResponse
{
    public double processing_time;
    public List<RecognitionResult> results;
    public string filename;
    public DateTime timestamp;

    public string AccuratePlate()
    {
        if (results == null || results.Count == 0)
            return string.Empty;

        if (results.Count == 1)
            return results.First().plate;

        //return Results.First(r => r.Score == Results.Max(x => x.Score)).Plate;
        return results.OrderByDescending(r => r.score).First().plate;
    }
}

[System.Serializable]
public class RecognitionResult
{
    public string plate;
    public double score;
    public double dscore;
}